def getcontents(pp):
    length = pp.contents.total
    contents = []
    for i in range (0,length):
        pairs1 = pp.contents.pindex1[i]
        pairs2 = pp.contents.pindex2[i]
        if((pairs1!=0)&(pairs2!=0)&(pairs1<700000)):
            contents.append([pairs1,pairs2])
    return contents


