def integf(shform):
    length = len(shform.columns.values)
    Pf=[]
    Pfindex=[]
    shform = shform.fillna(method='pad')
    for i in range (0,length-1):
        stock = shform[shform.columns[i]].values
        test = integ(stock)
        if (test==1):
            Pf.append(stock)
            Pfindex.append(shform.columns[i])
    return [Pf,Pfindex]


