#单独判断一阶单整序列
def integ(stock):
    test = fillna(stock)
    length = len(test)
    Plog = np.log(test)
    ret = []
    for i in range (1,length):
        ret.append(Plog[i]-Plog[i-1])
    if slowadf(Plog)==0 and slowadf(ret)==1:
        return 1
    else:
        return 0


