def slowadf(stock):
    adfctt = adfuller(stock,regression='ctt',autolag=None)
    if adfctt[0]<adfctt[4]['5%']:
        return 1
    else:
        adfct = adfuller(stock,regression='ct')
        if adfct[0]<adfct[4]['5%']:
            return 1
        else:
            adfc = adfuller(stock)
            if adfc[0]<adfc[4]['5%']:
                return 1
            else:
                return 0


